import React from 'react';
import './story_blok.css';
import { Avatar } from '@material-ui/core';

function Story_blok(props) {
  return (
    <div
      style={{
        backgroundImage: `url(${props.story}`,
      }}
      className='story_blok'
    >
      <Avatar
        src={props.proPic}
        style={{ margin: '10px', border: '5px solid #2e81f4' }}
      />
      <h4>{props.name}</h4>
    </div>
  );
}

export default Story_blok;
